	public boolean isSameTree(TreeNode p, TreeNode q) {
		if (p == null && q == null) {
			return true;
		} else if (p == null || q == null) {
			return false;
		} else {
			if (p.val == q.val) {
				return isSameTree(p.left, q.left) && isSameTree(p.right, q.right);
			} else {
				return false;
			}
		}
	}

	/**
	 * PROBLEM 226
	 */
	public TreeNode invertTree(TreeNode root) {
		if (root == null) {
			return root;
		} else if (root.left == null && root.right == null) {
			return root;
		} else {
			// left or right is not null
			TreeNode newleft = invertTree(root.left);
			TreeNode newright = invertTree(root.right);
			if (newleft == null) {
				root.left = newright;
				root.right = null;
			} else if (newright == null) {
				root.right = newleft;
				root.left = null;
			} else {
				// left and right are both not null
				root.left = newright;
				root.right = newleft;
			}
		} //
		return root;
	}

	/**
	 * PROBLEM 242
	 */
	public static boolean isAnagram(String s, String t) {
		if (s.length() != t.length()) {
			return false;
		}
		int[] array1 = new int[26];
		int[] array2 = new int[26];
		for (int j = 0; j < s.length(); j++) {
			int key = (int) (s.charAt(j) - 'a');
			int key2 = (int) (t.charAt(j) - 'a');
			array1[key]++;
			array2[key2]++;
		}
		for (int i = 0; i < 26; i++) {
			if (array1[i] > 0) {
				if (array1[i] != array2[i]) {
					return false;
				}
			}
		}
		return true;
	}

